import React, { Component } from 'react'
import Myapp from './info';


import {BrowserRouter as Router, Switch, Route,Link} from 'react-router-dom'
import Root from './root';
class App extends Component {
    render() {
        return (
            <Router>
                <Switch>
                    <ul>
                    <li><Route exact path='/' component={Myapp}></Route></li>
                    <li><Route exact path="/home" component={Root}></Route></li>
                    </ul>
                </Switch>
            </Router>
        );
    }
}

export default App ;
